export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},ivF1h20zNX:{data:{id:614,attributes:{imdbId:"tt0363771",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTc0NTUwMTU5OV5BMl5BanBnXkFtZTcwNjAwNzQzMw@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Rotten Tomatoes",Value:"76%"},{Source:"Metacritic",Value:"75\u002F100"}],item_lang:{data:{id:1277,attributes:{title:"The Chronicles of Narnia: The Lion, the Witch and the Wardrobe",plot:"Four children from the same family have to leave their town because of the bombings of WWII. A woman and a professor take the children to their house. While playing a game of hide-and-seek, the youngest member of the family, Lucy, finds a wardrobe to hide in. She travels back and back into the wardrobe and finds a place named Narnia. After going in twice, the four children go in together for the last time. They battle wolves, meet talking animals, encounter an evil white witch and meet a magnificent lion named Aslan. Will this be the end of their journey to Narnia or will they stay?",slug:"the-chronicles-of-narnia-the-lion-the-witch-and-the-wardrobe"}}},books:{data:[{id:4246,attributes:{title:g,description:"When this adaptation of C. S. Lewis's classic children's story opened at the RSC Stratford in November 1998, it received rave reviews and broke box office records. Four children are evacuated from London during the Blitz. While exploring the Professor's house, they stumble across the gateway to another world, and the adventure begins. The land of Narnia is under the spell of the wicked White Witch, and the four very quickly find themselves caught up in a deadly struggle between good and evil.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=54kHEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["C.S. Lewis"],firstBook:true,published:"2012-05-28",publisher:"Bloomsbury Publishing",subtitle:a}},{id:4247,attributes:{title:g,description:"The Lion, the Witch and the Wardrobe has enchanted readers for generations and now will delight younger children as a picture book. Brought to life through Christian Birmingham's stunning illustrations, this is a magical winter story for all the family. When Peter, Susan, Edmund and Lucy are sent to stay with a kind professor who lives in the country, they can hardly imagine the extraordinary adventure that awaits them. It all begins when the children explore the professor's rambling old house. When they come across a room with an old wardrobe in the corner, Lucy opens the door and gets inside. To her amazement, she suddenly finds herself standing in a wood, with snowflakes falling through the air. Lucy has found Narnia, a magical land of fauns and centaurs, nymphs and talking animals and the magnificent lion, Aslan. They are joined by the beautiful but evil White Witch, who has held the country in eternal winter for a hundred years. Christian Birmingham's exquisite illustrations bring the world of Narnia alive and provide the perfect setting for the carefully abridged story. It is a classic in its own right and a magical doorway to all the stories within the Narnia Chronicles.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9XefuAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:c,published:"2011-01-01",publisher:"Chronicles of Narnia",subtitle:a}},{id:4248,attributes:{title:"The Lion, the Witch and the Wardrobe (Large Print)",description:"Four English schoolchildren find their way through the back of a wardrobe into the magic land of Narnia and assist Aslan, the golden lion, to triumph over the White Witch, who has cursed the land with eternal winter.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4BZZPgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:c,published:"2002-04-16",publisher:h,subtitle:a}},{id:4249,attributes:{title:"The Lion, the Witch and the Wardrobe: Pocket Edition",description:"A beautiful pocket-sized edition of the much-loved children's classic. The most loved of all the Chronicles, this wonderful tale can be enjoyed again and again. Lucy steps into the Professor's wardrobe but steps out again into a snowy forest. She's stumbled upon the magical world of Narnia, land of unicorns, centaurs, fauns! and the wicked White Witch, who terrorises all. Lucy soon realises that Narnia, and in particular Aslan, the great Lion, needs her help if the country's creatures are ever going to be free again.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DeOuoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:c,published:"2014-09-11",publisher:h,subtitle:a}},{id:4250,attributes:{title:"The Lion, the Witch & the Wardrobe",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UPNFw6N-KpQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["C S Lewis"],firstBook:c,published:"1989-12-01",publisher:"Dramatic Publishing",subtitle:"One Act - Two Character"}}]}}},meta:{}}},prerenderedAt:1681377256813}}("","movie",null,"C. S. Lewis","series",1,"The Lion, the Witch and the Wardrobe","HarperCollins"))